        // } catch(error){
        //     alert(error.response.data.message);
        // }
    }
    return(
        <div className="container">
            <div className="header">
                <Header 
                    type={1}
                    leftChild={<button onClick={handleOnBack}>
                        <img alt="back" src={icon_back}/>
                    </button>}
                />
            </div>
            <div className="content">
                {isSearched ? "" :
                <Search onSubmit={onSubmit}/>}
